import "./App.css";
import { CheckList } from "./components/CheckList";
import { useState } from 'react';


function App() {
  const [kind, setKind] = useState("");

  return (
    <div className="mainContainer">
      <div className="mainTopButtonBox">
        <button className="mainTopButtons" onClick={() => setKind("first")}>first</button>
        <button className="mainTopButtons" onClick={() => setKind("second")}>second</button>
        <button className="mainTopButtons" onClick={() => setKind("third")}>third</button>
      </div>
      {
        kind === "first" ? <CheckList />
        : kind === "second" ? <div>second component</div>
        : kind === "third" ? <div>third component</div>
        : null
      }
    </div>
  );
}

export default App;
